  "content": "<p><strong>◎&nbsp;브런치 요리특강반을 개강합니다.</strong></p><p>1. 수업예정일자 : 2024년 4월 12일부터 개강 8주(16품목)</p><p>2. 수업요일 : 매주 금요일 오전11시~ 오후1시</p><p>3. 수업메뉴(2품목/1일)총16가지메뉴</p><p>- 새우감바스 / 김치스파게티 - 양송이스프 / 브런치플레이트</p><p>- 애플고르곤졸라피자 / 빠네 크림파스타 - 리코타 치즈샐러드 / 아보카도 에그베네딕트</p><p>- 루벤샌드위치 / 단호박스프 - 양송이크림소스 스테이크 / 매쉬포테이토</p><p>- 마르게리따피자 / 새우로제파스타 - 치킨샐러드 / 베이컨 소시지를 곁들인 프렌치토스트</p><p>※. 상기메뉴는 학원 사정상 일부 변동될 수 있습니다.</p><p><br></p><p>4. 수강료(재료비포함) : 2개월과정 ￦480,000</p><p><img src=\"data:image/png;base64,\" alt=\"image.png\" contenteditable=\"false\"><br></p>",
